import React from "react";

class Counter extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      time: "",
    };
    this.QuoteCreator = this.QuoteCreator.bind(this);
  }

  render() {
    const countDownDate = new Date("Jan 5, 2021 15:37:25").getTime();
    setInterval(function () {
      const now = new Date().getTime();

      // Find the distance between now and the count down date
      const distance = countDownDate - now;

      // Time calculations for days, hours, minutes and seconds
      const days = Math.floor(distance / (1000 * 60 * 60 * 24));
      const hours = Math.floor(
        (distance % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60)
      );
      const minutes = Math.floor((distance % (1000 * 60 * 60)) / (1000 * 60));
      const seconds = Math.floor((distance % (1000 * 60)) / 1000);

      // Display the result in the element with id="demo"
      const count = `   ${days} + "d " + ${hours} + "h "  + ${minutes}+ "m " + ${seconds} + "s "`;
      console.log(count);
    }, 1000);

    return (
      <React.Fragment>
        <h1>gifts in time for christmas</h1>
        <p>guaranreed delivery ends in</p>
      </React.Fragment>
    );
  }
}
export default Counter;
